__NUXT_JSONP__("/drugs/Nolatrexed_Dihydrochloride", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"152946-68-4",chebiId:"",chemicalFormula:"C14H12N4OS.2ClH",definition:"The dihydrochloride salt of nolatrexed, a water-soluble lipophilic quinazoline folate analog with antineoplastic activity. Nolatrexed occupies the folate binding site of thymidylate synthase, resulting in inhibition of thymidylate synthase activity and thymine nucleotide synthesis with subsequent inhibition of DNA replication, DNA damage, S-phase cell cycle arrest, and caspase-dependent apoptosis. This agent also exhibits radiosensitizing activity.",fdaUniiCode:"1XA69O733O",identifier:"C1577",preferredName:b,semanticType:"Organic Chemical",subclassOf:["C2021","C511"],synonyms:["3,4-Dihydro-2-amino-6-methyl-4-oxy-5-(4-pyridylthio)-quinazoline Dihydrochloride","AG-337","AG337","NOLATREXED DIHYDROCHLORIDE",b,"Nolatrexed Hydrochloride","Thymitaq","nolatrexed"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FNolatrexed_Dihydrochloride",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Nolatrexed_Dihydrochloride","Nolatrexed Dihydrochloride","2021-10-30T13:34:42.843Z")));